import EventsFilters from "../events/eventsfilters/EventsFilters";
import MoviesFilters from "../movies/moviesfilters/MoviesFilters";


function AddItem() {
    return ( 
        <div>
            <MoviesFilters/>
            <EventsFilters/>
        </div>
     );
}

export default AddItem;
